import React from 'react';
import { Container, Row } from 'react-bootstrap';

const PostList = (props) => {
    console.log(props);

    return (
        <Container>
            <Row> <ul>
            {props.posts.map((element, index) =>
                <li key={index}>
                    {element.title}
                </li>
            )}
        </ul>
                <Col>1 of 3</Col>
                <Col>2 of 3</Col>
                <Col>3 of 3</Col>
            </Row>
        </Container>

    )
}

export default PostList
